	// or <b>RelistFixedPriceItem</b>,
	// and you set <b>Item.InventoryTrackingMethod</b> to <b>SKU</b> at
	// the time the item was listed. (These criteria are necessary to
	// uniquely identify the listing by a SKU.)<br>
