	// values for the site on which you are listing (see <a href="http://developer.ebay.com/DevZone/guides/ebayfeatures/Development/Categories-DataMaintenance.html">Maintaining Category Data</a>
	// for information on working with categories). Also see
	// <b>Item.CategoryMappingAllowed</b> and
	// <b>Item.CategoryBasedAttributesPrefill</b>.<br>
