	// When you specify <b>ProductListingDetails</b>, you must specify at
	// least one product ID for the listing (<b>ProductID</b>,
	// ProductReferenceID, <b>ISBN</b>, <b>UPC</b>, <b>EAN</b>, <b>BrandMPN</b>, and/or <b>TicketListingDetails</b>). If you specify more than one of these values
	// (such as <b>UPC</b> and <b>BrandMPN</b>), eBay uses the first one
	// that matches a product in eBay's catalog system. (This may be useful
	// if you aren't sure which ID is more likely to result in a
	// match.)<br>
