	// This boolean field is returned as <code>true</code> if the listing category supports eBay Scheduled Delivery. A <code>true</code> value does not necessarily mean that the seller has enabled the item with the eBay Scheduled Delivery feature. A listing is enabled with the eBay Scheduled Delivery feature if the <b>eBayNowAvailable</b> field is returned as <code>true</code>.
