type ProductListingDetailsType struct {
	XMLName xml.Name `xml:"urn:ebay:apis:eBLBaseComponents ProductListingDetailsType"`

	//
	// If true, indicates that the item listing includes the stock photo. To use an
	// eBay stock photo in an item listing, set <b>IncludeStockPhotoURL</b> to true. If a
	// stock photo is available, it is used at the top of the View Item page and in
	// the Item Specifics section of the listing. If you also include
	// <b>Item.PictureDetails.PictureURL</b>, the stock photo only appears in the Item
	// Specifics section of the listing. Other pictures you specify by using
	// <b>Item.PictureDetails.PictureURL</b> appear in a separate section of the listing.
	// In <b>GetItem</b>, the URL of the stock photo will be returned in <b>StockPhotoURL</b>. If you
	// set <b>IncludeStockPhotoURL</b> to false, the stock photo does not appear in the
	// listing at all.<br>
	// <br>
	// <span class="tablenote"><b>Note:</b>
	// The following sites offer free Gallery: US (site ID 0), the Parts & Accessories
	// Category on US Motors (site ID 100), CA (site ID 2), CAFR (site ID 210), ES (site ID
	// 186), FR (site ID 71), IT (site ID 101),and NL (site ID 146).
	// <br><br>
	// On these sites, eBay selects a Gallery thumbnail from image URLs included
	// in the request (i.e., either <b>GalleryURL</b> or the first PictureURL), using
	// selection rules that consider which of these URLs has been specified and
	// whether an eBay stock photo exists for the item. Also, eBay selects an
	// image regardless of whether you have specified either <b>GalleryType</b> or
	// <b>GalleryURL</b>. A Gallery fee will only apply if you have set GalleryType to
	// Plus or Featured (as basic Gallery is free).<br>
	// <br>
	// Along with these changes, <b>IncludeStockPhotoURL</b> will be used in the request.
	// In some cases, if <b>IncludeStockPhotoURL</b> is set to false, no image will be
	// generated for the Gallery. A common example of this occurrence is when only
	// <b>GalleryURL</b> has been set in the request (i.e., no PictureURL elements are
	// defined). In this case, eBay will not use a stock photo, even if it is
	// available.
	// </span>
	// <br><br>
	// Not applicable to Half.com.
	//
	IncludeStockPhotoURL bool `xml:"IncludeStockPhotoURL,omitempty"`

	//
	// If <code>true</code>, indicates that the stock photo for an item (if available) is used as
	// the gallery thumbnail. When listing an item, <b>IncludeStockPhotoURL</b> must also
	// be true and <b>Item.PictureDetails.GalleryType</b> must be passed in with a value of
	// Gallery or Gallery Featured (but not both). Passing in
	// <b>Item.PictureDetails.GalleryURL</b> takes precedence over
	// <b>UseStockPhotoURLAsGallery</b>. See the eBay Features Guide for additional
	// validation rules for pictures. <br>
	// <br>
	// <span class="tablenote"><b>Note:</b>
	// The following sites offer free Gallery: US (site ID 0), the Parts & Accessories
	// Category on US Motors (site ID 100), CA (site ID 2), CAFR (site ID 210), ES (site ID
	// 186), FR (site ID 71), IT (site ID 101),and NL (site ID 146).
	// <br><br>
	// On these sites, eBay selects a Gallery thumbnail from image URLs included
	// in the request (i.e. either <b>GalleryURL</b> or the first PictureURL), using
	// selection rules that consider which of these URLs has been specified and
	// whether an eBay stock photo exists for the item. Also, eBay selects an
	// image regardless of whether you have specified either <b>GalleryType</b> or
	// GalleryURL. A Gallery fee will only apply if you have set <b>GalleryType</b> to
	// Plus or Featured (as basic Gallery is free).<br>
	// <br>
	// Along with these changes, <b>UseStockPhotoURLAsGallery</b> will be used in the
	// request. In some cases, if <b>UseStockPhotoURLAsGallery</b> is set to false, no
	// image will be generated for the Gallery. A common example of this
	// occurrence is when only <b>GalleryURL</b> has been set in the request (i.e., no
	// PictureURL elements are defined). In this case, eBay will not use a stock
	// photo, even if it is available.
	// </span>
	// <br>
	//
	UseStockPhotoURLAsGallery bool `xml:"UseStockPhotoURLAsGallery,omitempty"`

	//
	// Fully qualified URL for a standard image (if any) that is associated with the product.
	// A seller includes the stock photo in the listing
	// by setting <b>IncludeStockPhotoURL</b>.
	//
	StockPhotoURL *AnyURI `xml:"StockPhotoURL,omitempty"`

	//
	// Copyright statement indicating the source of the product information. This information will be
	// included in the listing with Pre-filled Item Information. Your application should also display
	// the copyright statement when rendering the Pre-filled Item Information.
	// If more than one copyright statement is applicable, they can be presented to the
	// user in alphabetical order. Returned as HTML.
	// Output only.
	//
	Copyright []string `xml:"Copyright,omitempty"`

	//
	// eBay's short global reference ID for a catalog product.
	// On the eBay Web site, this is known as the "ePID" or "Product ID".
	// This type of product ID is a fixed reference to a product
	// (regardless of version).
	// Multiple (versioned) <b>ProductID</b> values can be associated with a
	// single product reference ID.
	// You can find product reference IDs for products by using <b>FindProducts</b> in
	// the Shopping API.
	// You can also find the product ID on eBay's Web site
	// (a numeric value prefixed with "EPID").
	// You can pass the value with or without the "EPID" prefix;
	// for example "EPID228742" or "228742" (without quotes).
	// <br><br>
	// If the primary and secondary categories are both catalog-enabled, this ID should
	// correspond to the primary category (not the secondary category).
	// <br><br>
	// Some sites (such as eBay US, Germany, Austria, and Switzerland) are updating,
	// replacing, deleting, or merging some products (as a result of migrating from one
	// catalog data provider to another). If you specify one of these products in a request,
	// the call may return the product with a warning, or it may return an error if the
	// product has been deleted.
	//
	ProductReferenceID string `xml:"ProductReferenceID,omitempty"`

	//
	// This field is deprecated.
	//
	DetailsURL *AnyURI `xml:"DetailsURL,omitempty"`

	//
	// This field is deprecated.
	//
	ProductDetailsURL *AnyURI `xml:"ProductDetailsURL,omitempty"`

	//
	// Applicable for listing use cases only (not buy-side searching).
	// Indicates what eBay should do if more than one product matches
	// the external product ID (ISBN, UPC, EAN, Brand-MPN combination) or
	// event specified through <b>TicketListingDetails</b> . Also see <b>UseFirstProduct</b> as an alternative.<br>
	// <br>
	// If true and more than one
	// match is found, the call fails and the response
	// returns an error and all matching Product ID values.
	// This lets you choose one of the Product IDs to pass in instead.
	// If false and more than one match is found, the call fails and the
	// response includes an error but does not return the matching
	// Product ID values. (This flag has no effect when only one match is
	// found.)
	//
	ReturnSearchResultOnDuplicates bool `xml:"ReturnSearchResultOnDuplicates,omitempty"`

	//
	// Applicable for listing use cases only (not buy-side searching).
	// ISBN is a unique identifer for books (an international standard).
	// Specify a 10 or 13-character ISBN. If you specify the
	// 13-character ISBN, the value must begin with either 978 pr 979.
	// If the primary and secondary categories are both catalog-enabled,
	// this ID should correspond to the primary category
	// (not the secondary category).
	//
	ISBN string `xml:"ISBN,omitempty"`

	//
	// Applicable for listing use cases only (not buy-side searching). UPC is a unique,
	// 12-character identifier that many industries use to identify products.
	// <br><br>
	// If the primary and secondary categories are both catalog-enabled, this ID should
	// correspond to the primary category (not the secondary category).
	//
	UPC string `xml:"UPC,omitempty"`

	//
	// Applicable for listing use cases only (not buy-side searching).
	// EAN is a unique 8 or 13 digit identifier that many industries
	// (such as book publishers) use to identify products.
	// If the primary and secondary categories are both catalog-enabled,
	// this ID should correspond to the primary category
	// (not the secondary category).
	//
	EAN string `xml:"EAN,omitempty"`

	//
	// Applicable for listing use cases only (not buy-side searching). The combination of Brand and MPN (manufacturer part number) can be used as a unique identifier for a product. If this container is used, both <b>Brand</b> and <b>MPN</b> must be specified.
	// <br>
	// <br>
	// It is a best practice to also specify the Brand/MPN values in two separate <b>ItemSpecifics.NameValueList</b> containers. The values in the <b>BrandMPN</b> container are used to look for an eBay catalog product match, but if a match is not found, these Brand and MPN values are dropped from the listing. By also specifying these Brand and MPN values in Item Specifics, these values are retained in the listing. If the Brand and MPN values in the <b>BrandMPN</b> container and <b>ItemSpecifics.NameValueList</b> containers differ, the values in the <b>ItemSpecifics.NameValueList</b> containers will overwrite the values of the <b>BrandMPN</b> container.
	// <br>
	// <br>
	// <span class="tablenote"><b>Note:</b>
	// The <b>BrandMPN</b> container (and eBay catalog product lookup) is not supported for multiple-variation listings. For multiple-variation listings that use MPNs, the <b>Brand</b> value should be specified through an <b>ItemSpecifics.NameValueList</b> container, and the  Manufacturer Part Numbers (MPNs) for each product variation should be specified through a <b>VariationSpecifics.NameValueList</b> container.
	// </span>
	//
	BrandMPN *BrandMPNType `xml:"BrandMPN,omitempty"`

	//
	// Applicable for listing use cases only (not buy-side searching).
	// Only applicable when you are listing event tickets.
	// Please note that the US eBay site and other sites may also require
	// you to specify additional Item Specifics by using AttributeSetArray.
	// This may depend on the location of the event.
	// See the eBay Features Guide for more information about how to
	// specify and troubleshoot these values.
	//
	TicketListingDetails *TicketListingDetailsType `xml:"TicketListingDetails,omitempty"`

	//
	// Applicable for listing use cases only (not buy-side searching). Indicates what eBay
	// should do if more than one product matches the external product ID (ISBN, UPC, EAN,
	// <b>BrandMPN</b>, or <b>TicketListingDetails</b>). Also see <b>ReturnSearchResultOnDuplicates</b> as an
	// alternative. If more than one product match was found and <b>UseFirstProduct</b> is true, item
	// will be listed with first product information. If false, the rules for
	// ReturnSearchResultOnDuplicates are used.
	//
	UseFirstProduct bool `xml:"UseFirstProduct,omitempty"`

	//
	// This boolean field controls whether or not an eBay catalog product is used to help create or revise an item listing. If a product identifier value is provided through the <b>ProductListingDetails</b> container when adding, revising, or relisting an item, the default behavior is for eBay to try and find a match for the product in the eBay product catalog, and then automatically create the listing title, item specifics, item description, pictures (for "New" condition items), and assign a category.
	// <br><br>
	// If the seller wants to use the eBay product catalog to help create or revise the listing, the seller can include this field and set its value to <code>true</code>, or just omit this field, as it default value is <code>true</code>. If a seller doesn't want the eBay product catalog information in their listing, that seller would have to include this field and set its value to <code>false</code>. If the seller does this, they will also be required to pass in their own listing title and description, item specifics, and pictures, and select a listing category.
	// <br>
	// <br>
	// <span class="tablenote"><b>Note:</b> Beginning with version 939, this boolean field has essentially replaced the soon-to-be deprecated <b>IncludePrefilledItemInformation</b> boolean field. However, the <b>IncludePrefilledItemInformation</b> boolean field will still work with versions prior to 939 until March 2017.</span>
	//
	IncludeeBayProductDetails bool `xml:"IncludeeBayProductDetails,omitempty"`
}

