type QuantityInfoType struct {
	XMLName xml.Name `xml:"urn:ebay:apis:eBLBaseComponents QuantityInfoType"`

	//
	// Enables you (the seller) to avoid being left with 1 item in your
	// listing. A typical use case is event tickets in reserved,
	// adjacent seats, or items that typically only sell if more than
	// 1 can be purchased at once. <br>
	// <br>
	// Specify the minimum number of items that
	// should remain if a buyer doesn't purchase all the items.
	// Based on the value of MinimumRemnantSet and the listing's
	// available quantity (Quantity-QuantitySold), eBay calculates how many
	// items a buyer can purchase.
	// For example, suppose you list 5 tickets, and you want at least
	// 2 tickets remaining for the final buyer to purchase.
	// In this case, you would set MinimumRemnantSet to 2.
	// This means a buyer can purchase 1, 2, 3, or 5 tickets, but not 4
	// (because 4 would leave the seller with 1 ticket).<br>
	// <br>
	// To remove this restriction when you revise or relist,
	// set MinimumRemnantSet to 1.<br>
	// <br>
	// Applicable to multi-quantity, fixed-price listings.
	// Currently supported for US and CA event ticket listings.
	//
	MinimumRemnantSet int32 `xml:"MinimumRemnantSet,omitempty"`
}

type QuantityRestrictionPerBuyerInfoType struct {
	XMLName xml.Name `xml:"urn:ebay:apis:eBLBaseComponents QuantityRestrictionPerBuyerInfoType"`

	//
	// This integer value indicates the maximum quantity of items that a single buyer may
	// purchase during the duration of a fixed-price listing (single or multi-variation).
	// The buyer is blocked from the purchase if that buyer is attempting to purchase a
	// quantity of items that will exceed this value. Previous purchases made by the buyer
	// are taken into account. For example, if <b>MaximumQuantity</b> is set to
	// '5' for an item listing, and <em>Buyer1</em> purchases a quantity of
	// three, <em>Buyer1</em> is only allowed to purchase an additional
	// quantity of two in subsequent orders on the same item listing.
	// <br/><br/>
	// This field is required if the <b>QuantityRestrictionPerBuyer</b>
	// container is used.
	//
	MaximumQuantity int32 `xml:"MaximumQuantity,omitempty"`
}

type RateTableDetailsType struct {
	XMLName xml.Name `xml:"urn:ebay:apis:eBLBaseComponents RateTableDetailsType"`

	//
	// On input, this field specifies which domestic shipping rate table to apply to a listing. Domestic rate tables can be used only for items listed on the eBay US, UK, DE, AU and Motors Parts and Accessories websites.
	// <br><br>
	// Currently, sellers can configure only one domestic shipping rate table, so set <strong>DomesticRateTable</strong> = <code>Default</code> to apply that table. The rates assigned to the various domestic regions are applied depending on the location of the buyer. If only one shipping service category and rate has been set for a given domestic region in the domestic rate table, buyers in that region will see only one shipping cost. If several service levels and rates are set up in the domestic shipping rate table for a given domestic region, buyers in that region will see the different shipping levels and rates and can choose one of them.
	// <br><br>
	// If you are modifying or relisting an item (using the Revise or Relist family of calls), you can delete the existing rate table setting applied to the listing by using the empty tag: <code>&lt;DomesticRateTable /&gt;</code>
	// <br><br>
	// This field is returned from the GetItem family of calls only for the seller who listed the item.
	// <br><br>
	// You can find more information about using shipping rate tables in the Shipping chapter of the Trading API User's Guide.
	//
	DomesticRateTable string `xml:"DomesticRateTable,omitempty"`

	//
	// On input, this field specifies which international shipping rate table to apply to a listing. International rate tables can be used only for items listed on the eBay US, UK and DE sites.
	// <br><br>
	// Currently, sellers can configure only one international shipping rate table, so set <strong>InternationalRateTable</strong> = <code>Default</code> to apply that table. The rates assigned to the various countries are applied depending on the location of the buyer. If only one shipping service category and rate has been set for a given country in the international rate table, buyers in that country will see only one shipping cost. If several service levels and rates are set up in the international shipping rate table for a given country, buyers in that country will see the different shipping levels and rates and can choose one of them.
	// <br><br>
	// If you are modifying or relisting an item (using the Revise or Relist family of calls), you can delete the existing rate table setting applied to the listing by using the empty tag: <code>&lt;InternationalRateTable /&gt;</code>
	// <br><br>
	// This field is returned from the GetItem family of calls only for the seller who listed the item.
	// <br><br>
	// You can find more information about using shipping rate tables in the Shipping chapter of the Trading API User's Guide.
	//
	InternationalRateTable string `xml:"InternationalRateTable,omitempty"`
}

