	// <span class="tablenote"><b>Note:</b> The  <b>RefundOption</b> values supported on the US site are <code>MoneyBack</code> and <code>MoneyBackOrReplacement</code>. If a seller has the depth of inventory to support an exchange for an identical item,  <code>MoneyBackOrReplacement</code> can be used.  A seller with limited inventory of an item should use the <b>MoneyBack</b> option.
