	//
	// Indicates whether the seller allows the buyer to return the item.
	// This field is required when <b>ReturnPolicy</b> is specified.
	// If you specify <b>ReturnsNotAccepted</b>, the View Item page will indicate that returns are not accepted instead.)<br>
