	// <br/><br/>
	//
	// <strong>For the RelistItem family of calls</strong>, you can omit <strong>ExtendedHolidayReturns</strong> from the input if its value does not need to change.
	// <br/><br/>
	//
	// <strong>For the GetItem call</strong>, <strong>ExtendedHolidayReturns</strong> is returned only if the site you sent the request to supports the seller's return policy. Typically, this is only when the request is sent to the listing site.
	// <br/><br/>
	//
